import React from 'react'

const Navbar = () => {
  return (
    <div className='Navbar'>
      <div className='main'>
        <div className='left'>Left</div>
        <div className='center'>Center</div>
        <div className='right'>Right</div>
      </div>
    </div>
  )
}

export default Navbar
